part of 'authentication_cubit.dart';abstract class AuthenticationState extends Equatable {  const AuthenticationState();  @override  List<Object?> get props => [];}class AuthInitial extends AuthenticationState {}class AuthLoading extends AuthenticationState {}class Authenticated extends AuthenticationState {  final User user; // model  const Authenticated(this.user);  @override  List<Object?> get props => [user];}class UnAuthenticated extends AuthenticationState {}class AuthError extends AuthenticationState {  final String message;  const AuthError(this.message);  @override  List<Object?> get props => [message];}